import React, { Component } from 'react';
import Provider from '@react/react-spectrum/Provider';
import ProtoShell from '../Components_old/Shell';
import ProtoNav from './Components/SideNav';
import ProtoTableView from '../Components_old/TableView';
import ProtoHeader from '../Components_old/Breadcrumb';

class App extends Component {
    render() {
        return (
            <Provider theme='light' style={{ "backgroundColor": "rgb(245, 245, 245)", "height": "calc=(100vh - 52px)" }}>
                <ProtoShell></ProtoShell>
                <div className="Container">
                    <div className="Container-body">
                        <div className="Container-content">
                            <ProtoHeader></ProtoHeader>
                            <ProtoTableView></ProtoTableView>
                        </div>
                        <nav className="Container-nav"><ProtoNav></ProtoNav></nav>
                        <aside className="Container-rRail">adsadsadsadsadsadsadsadsadsadsadsadsadsadsadsadsads</aside>
                    </div>
                </div>
            </Provider>
        );
    }
}

export default App;
